import { Component, OnInit } from '@angular/core';
import { ContatoServiceService } from 'src/app/Services/Contato/contato-service.service';

import { Contato } from 'src/app/Models/Contato';

@Component({
  selector: 'app-home-contato',
  templateUrl: './home-contato.component.html',
  styleUrls: ['./home-contato.component.css']
})
export class HomeContatoComponent {
  contatos: Contato[] = [];
  constructor(private contatoService: ContatoServiceService) { }

  ngOnInit(): void {
    this.contatoService.BuscarTodos().subscribe(contatosResponse => {
      this.contatos = contatosResponse.data;
    });
  }
}
